import './App.css';

function App() {
  return (
    <div className="App">
      <div className="TitleSection">
      <h1>Pokemon Stats</h1>
      <input type="text" placeholder='Pokemon' />
      <button>Search</button>
      </div>
    </div>
  );
}

export default App;
